import React, { useState } from "react";
import DataTable from ".\DataTable.jsx";

const AdminManagement = ({ setSelected, accvalues }) => {
  // State for search term
  const [searchTerm, setSearchTerm] = useState("");

  // Handler for the "Add Account" button
  const handleAddAccount = () => {
    if (setSelected) {
      setSelected("AddAdminAccount");
    } else {
      console.error("setSelected function is not passed as a prop.");
    }
  };

  return (
    <div className="admin-management-container">
      <div className="header">
        <h2>Admin Accounts</h2>
        <button
          id="add-account"
          onClick={handleAddAccount}
          className="bg-blue-500 hover:bg-blue-600 text-white font-bold py-2 px-2 sm:px-4 sm:py-2 rounded text-xs sm:text-sm md:text-md"
        >
          + Add Account
        </button>
      </div>

      <div className="search-bar">
        <input
          type="text"
          placeholder="Search accounts..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
          className="border p-2 rounded w-full"
        />
      </div>

      {/* DataTable Component */}
      <DataTable
        accvalues={accvalues}
        setSelected={setSelected}
        searchTerm={searchTerm}
      />
    </div>
  );
};

export default AdminManagement;
